webpackJsonp([33],{392:function(e,a){e.exports={data:{config:{siteMetadata:{title:"Bricolage",author:"Kyle Mathews"}},markdown:{id:"/Users/kylemathews/programs/blog/pages/2011-04-09---richard-hamming-luck/index.md",bodyHTML:'<p>From Richard Hamming\'s classic and must-read talk, "<a href="http://www.cs.virginia.edu/~robins/YouAndYourResearch.html">You and Your Research</a>".</p>\n<blockquote>\n<p>There is indeed an element of luck, and no, there isn\'t. The prepared mind sooner or later finds something important and does it. So yes, it is luck. <em>The particular thing you do is luck, but that you do something is not.</em></p>\n</blockquote>\n',frontmatter:{readNext:null,title:"Richard Hamming on Luck",tags:["luck"],date:"April 09, 2011"}}},pathContext:{path:"/richard-hamming-luck/",component:"/Users/kylemathews/programs/blog/pages/blog-post.js"}}}});
